import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import PropertyList from './components/PropertyList';
import PropertyDetail from './components/PropertyDetail';
import PropertyForm from './components/PropertyForm';
import { properties as initialProperties } from './data/mockData';
import './App.css';

function App() {
  const [properties, setProperties] = useState(initialProperties);

  const handleAddProperty = (newProperty) => {
    setProperties(prev => [...prev, newProperty]);
  };

  return (
    <Router>
      <div className="App">
        <Header />
        <main style={{ minHeight: 'calc(100vh - 200px)', backgroundColor: '#f9fafb' }}>
          <Routes>
            <Route path="/" element={<PropertyList properties={properties} />} />
            <Route path="/imovel/:id" element={<PropertyDetail properties={properties} />} />
            <Route path="/publicar" element={<PropertyForm onSubmit={handleAddProperty} />} />
          </Routes>
        </main>
        <footer style={{ 
          backgroundColor: '#1f2937', 
          color: 'white', 
          textAlign: 'center', 
          padding: '2rem',
          marginTop: '3rem'
        }}>
          <p>&copy; 2025 Im√≥veisAluguel. Todos os direitos reservados.</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
